import "./Dialogs.css";

const Dialogs = (props) => {
  return (
    <div className="dialogs">
      <div className="dialogs-items">
        <div className="dialog">Maria</div>
        <div className="dialog">Anna</div>
        <div className="dialog">Ani</div>
        <div className="dialog">Armen</div>
        <div className="dialog">Artak</div>
      </div>
      <div className="messages">div.message</div>
    </div>
  );
};

export default Dialogs;
